import{_ as p,a0 as e,a1 as a,a4 as t}from"./framework-786d5328.js";const c={},r=t('<h1 id="特别的明天" tabindex="-1"><a class="header-anchor" href="#特别的明天" aria-hidden="true">#</a> 特别的明天</h1><p>明天是礼拜三，十五号，好特别的一天。</p><p>首先是严俊杰的生日。明天想给他买点甜品，但不能确定他在不在家，我还是直接问好了，免得除了差错，直接问一问他什么时候有空。</p><p>然后明天也是朱晨阳说要还我钱的日子。说实话已经对我来说平平无奇了，大概率是不能全部还给我的。不知道他的钱花在哪里了，怎么攒不起钱的喂。</p><p>明天也是月中了，我之前刷到的塔罗牌说我在月初的时候可以收到满意的offer，讲道理应该是今天才是的。哈哈，我硬是把它理解成月中吧。</p><p>说到底，还是我心中的那股执念太深了吧。尽管心里已经知晓十之六七了，但还是心存侥幸的，还是残存一丝希望的。你要是真的很厉害，真的很符合他们的职位要求，他们应该是巴不得，面完试的第二天就通知你的。还是有一丝丝的可惜的吧。不敢去问了，这周五最后问一下吧。</p><p>这两天的精神状态属实不错，都是早睡早起的缘故！不打哈欠了，也很少会胡思乱想了，精神也饱满了。再接再厉~~</p><p>几天搭建后端的环境搭了一天了，好在身边的人都非常的友好，会帮我解决问题，真的很感谢他们。</p><p>简单的看了一下需求，发现了一个bug，已经定位到了差不多是源码的问题。</p><p>现在似乎已经习惯这种感觉了，在签外包协议的时候，内心的波动明显比之前要少了很多。尽管还是非常的不甘心，他们给我的感觉真的是高高在上哦。前端似乎真的已死，真的不被人需要了嘛？我在安硕，没有一点存在感的，没有一点地位的。明伟还开玩笑说我是浙江管理部门的大宝贝。哈哈，有一点点被重视的感觉。</p><p>应该是处于一个想证明自己价值所在的年纪吧？我在哪个地方可以发光发热，可以被真正的重视，被真正的需要，被真正的看得起。我非常的需要被人的尊重，我急切的找回自己的尊严、找回自己的自信，我太需要这些东西了。</p><p>接下来的日子，可能很少会写技术类型的文章了。九九六的制度压得我有点难接受。</p><p>似乎已经慢慢习惯现在的生活了。</p><p>再伟大的尊严，也需要你有足够的经济实力。</p><p>吃饱穿暖，再去找尊严咯</p><p>迷茫</p>',16),o=[r];function _(n,s){return e(),a("div",null,o)}const i=p(c,[["render",_],["__file","4.html.vue"]]);export{i as default};
